import { Component, OnInit } from '@angular/core';
import { LoginService } from '../../services/login.service';

@Component({
  selector: 'app-page5',
  templateUrl: './page5.component.html',
  styleUrls: ['./page5.component.css']
})
export class Page5Component implements OnInit {
  buttonStats: any[] = [];

  constructor(private loginService: LoginService) { }

  ngOnInit(): void {
    const userId = '1'; // Kullanıcı ID'sini buraya koyun (örneğin: login olan kullanıcının ID'si)

    this.loginService.getButtonStats(userId).subscribe(data => {
      this.buttonStats = data.buttonStats;
    }, error => {
      console.error('Error fetching button stats', error);
    });
  }
}
